import TodoItem from './TodoItem';
import './TodoItemList.css';

const TodoItemList = ({ todoList, onRemove, onChange }) => {
    const todoListHTML = todoList.map(
        ({id, content, isDone}) => {
            return <TodoItem
                key={id}
                id={id}
                content={content}
                isDone={isDone}
                onRemove={onRemove}
                onChange={onChange}
            />
        }
    );

    return (
        <div className="todo-list-wrapper">
            {todoListHTML}
        </div>
    );
}

export default TodoItemList;
